import logo from './logo.svg';
import './App.css';
import {Route,Routes,BrowserRouter} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <route path="/" element={<HomePage/>}/>
          <route path="/about" element={<About/>}/>
          <route path="/Projects" element={<Pr/>}/>
          <route/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
